  false,\n\t\"url\": null,\n\t\"notes\": \"We studied young of the year sablefish
  Anoplopoma fimbria to collect basic life history information on their abundance,
  growth, and diet and to determine whether forecasting year class abundance based
  on young of the year surveys was practical. Surface gillnet surveys were conducted
  annually from 1995 to 2004 along the seaward edge of the continental shelf of Alaska.
  Otoliths were extracted from a random subset of juvenile sablefish sampled by gillnet.
  This data set includes voucher otoliths from these studies.\",\n\t\"license_title\":
